import React from "react";
import { animated } from "react-spring";

const Menu = (style) => {
	return (
		<animated.div>
			<nav>
				<ul>
					<li>
						<a href="/">Home</a>
					</li>
					<li>
						<a href="/">Weather</a>
					</li>
					<li>
						<a href="/">Your Tour</a>
					</li>
					<li>
						<a href="/">Contact</a>
					</li>
				</ul>
			</nav>
		</animated.div>
	);
};

export default Menu;
